    false,nt"url": null,nt"notes": "LiDAR data was acquired by Tuck Mapping
    Solutions, Inc. (TMSI) for the Chemung Watershed and broken down into two AOIs based
    on the level of processing performed on the dataset. AOI-1 covers approximately
    709 square miles, which is the full extent of the acquisition boundary plus a 100-meter
    buffer around the perimeter of this boundary. AOI-1 was delivered as full-swath,
    calibrated, and boresighted flight lines in LAS format. A subset of AOI-1, delineated
    by a buffer around the major stream networks, covers approximately 308 square miles.
    RAMPP will make the following products available to FEMA by uploading the digital
    data to the MIP, where applicable, or via hard drives. The deliverables for this
    Technical Support Data Notebook (TSDN) submittal include written certification that
    the topographic data development meets minimum Federal Emergency Management Agency
    (FEMA) standards and specifications. In cases where data do not meet the required
    standards and specifications, an explanation is included. Additionally, the related
    metadata file has been uploaded to the Mapping Information Platform (MIP). Deliverables
    will include raw point clouds and classified point clouds (see report for details),
    hydro-lines, low confidence polygons, qa/qc report, survey report and a summary
    report. Classifications include ASPRS Class 1,2,7,9,11. Acquisition AOI-2 fulfills
    this dataset (see Page 3 of the Final Topographic Data Developmental Report).",nt"owner_org":
